Before going anywhere I do a lot of research to make it as enjoyable as possible. Finding activities, places to eat, and things to see authentic to each area. Family friendly is obviously a huge plus! I love to find tips to make things easier and what to avoid too. Here are some photos of our favorite things we did when we visited Anna Maria Island…

@thedonutexperimentannamaria where you can literally create your own donuts by choosing the ingredients and toppings. These fresh and delicious cake donuts should not be missed! 

@shinyfishemporium is a unique boutique with all sorts of beautiful gifts, especially for little girls! I did a lot of Christmas shopping there! But they also have a fun activity where you can go in and paint sand dollars! Once dry they add sparkles and turn it into an ornament! 

@twoscoopsami has delicious ice cream, chili dogs, and the sweetest employees! We enjoyed lunch with sweet treats while we watched Princess and the Frog. 

💡When visiting the beach we took advantage of the beaches umbrella and chair services! Especially since I was by myself with the kids. Giving us shade without all the work of dragging everything to the beach. It was $30 for the day for two chairs and an umbrella. 

Paired with staying at @compassannamaria and enjoying the pool we were never short on things to do. We loved our visit and Anna Maria will continue to be a place we go back to. Enjoying the nostalgia and making new memories each time.

Make sure you save this post for when you plan your time there! 

